import React from 'react';

export default class UserTransactionCounter extends React.Component {
    render() {
        const {transactions, user, timePeriod} = this.props;
        let usersTransactions = transactions.filter(transaction => transaction.initials === user).filter(transaction=>transaction.entrytimestamp > timePeriod.lowerBoundry && transaction.entrytimestamp <= timePeriod.upperBoundry)
        let countOfGowns = usersTransactions.filter(transaction => transaction.gown>0).length
        console.log(`gowns: ${countOfGowns}`);
        return (
            <div>hi</div>
        );
  }
}
